INSERT INTO `submateri` (`kode_submateri`, `nama_submateri`, `isi_submateri`, `gbr_submateri`, `kode_materi`, `id_admin`) VALUES
('1IL001', 'Pengertian Ilmu Kimia ', '<p>Ilmu kimia merupakan ilmu pengetahuan alam yang mempelajari tentang materi kimia, dan juga meliputi karakteristik dari materi kimia tersebut secara luas. Materi kimia merupakan segala sesuatu yang memiliki massa dan menempati ruang.</p>', '', '1IL', 'ra'),
('1IL002', 'Kedudukan Ilmu Kimia Dalam Profesi', '<p>Ilmu kimia dapat diterapkan oleh berbagai bidang profesi, terutama untuk bidang-bidang profesi sebagai berikut.</p><ul><li>Farmasi</li><li>Kedokteran</li><li>Ahli Gizi atau Pangan</li><li>Pertanian</li><li>Geologi</li><li>Analis Kimia</li><li>Industri Kimia</li></ul><p>Bidang-bidang profesi diatas memang serumpun dengan apa yang dipelajari dalam ilmu kimia, maka dari itu, pada bidang-bidang tersebut memang butuh dan perlu untuk menerapkan ilmu kimia secara mendalam. Namun, tidak menutup kemungkinan untuk profesi di bidang selain yang telah disebutkan di atas untuk bisa menerapkan ilmu kimia.</p>', '', '1IL', 'ra'),
('2KM001', 'Sifat Materi Kimia', '<p>Sifat materi kimia dibagi berdasarkan jumlahnya dan perubahan yang terjadi. Berikut sifat materi kimia berdasarkan jumlahnya.</p><ul><li>Sifat ekstensif, meliputi berat dan volume.</li><li>Sifat intensif, meliputi warna dan daya hantar listrik.</li></ul><p>Berikut sifat materi kimia berdasarkan perubahan yang terjadi.</p><ul><li>Sifat fisis, contohnya massa, volume, dan kalor.&nbsp;</li><li>Sifat kimia, contohnya karat dan pembusukan.</li></ul>', '', '2KM', 'ra'),
('2KM002', 'Wujud dan Perubahan', '<p>Berikut merupakan karakteristik dari wujud materi kimia yang berupa padat, fluid atau cair, dan gas.</p><ul><li>Karakteristik dari wujud materi kimia yang berupa padatan : Memiliki bentuk tertentu, Memiliki volume tertentu</li><li>Karakteristik dari wujud materi kimia yang berupa fluid atau cair : Bentuk mengikuti wadah, Memiliki volume tertentu</li><li>Karakteristik dari wujud materi kimia yang berupa gas : Bentuk mengikuti wadah, Memiliki volume yang tidak menentu</li></ul><p>Perubahan fisik yang terjadi pada suatu materi kimia yang berwujud padat, cair, dan gas adalah sebagai berikut.</p><ul><li>Mencair, yaitu perubahan wujud dari padat menjadi fluid atau cair.</li><li>Menguap, yaitu perubahan wujud dari fluid atau cair menjadi gas.</li><li>Mengkristal, yaitu perubahan wujud dari gas menjadi padat.</li><li>Menyublim, yaitu perubahan wujud dari padat menjadi gas.</li><li>Mengembun, yaitu perubahan wujud dari gas menjadi fluid atau cair.</li><li>Membeku, yaitu perubahan wujud dari fluid atau cair menjadi padat.</li></ul>', '', '2KM', 'ra'),
('3UN001', 'Pengertian Unsur Kimia', 'Unsur merupakan suatu zat yang hanya mengandung satu jenis atom. Variasi yang luar biasa disekeliling kita tersusun dari substansi-substansi yang juga bisa disebut dengan unsur. Singkatnya Unsur merupakan bahan murni yang tidak dapat dipecah menjadi lebih sederhana lagi. Unsur harus berkombinasi dahulu baru bisa membentuk senyawa, Kebanyakan unsur membentuk kombinasi dua, tiga, atau lebih, untuk membentuk senyawa.\r\n', NULL, '3UN', 'talithaa26'),
('3UN002', 'Jenis Pengelompokkan Unsur', '<p>Dengan berdasarkan penemuannya, unsur tersebut dikelompokkan kedalam 2 kelompok, yakni :</p><ul><li>Unsur Alami, merupakan unsur yang murni. Sekarang ini sudah ditemukan 115 unsur, 90 dari itu adalah unsur yang alami. Pada tiap-tiap substansi di bumi tersebut tersusun atas satu atau juga lebih dari 90 unsur ini. Oksigen adalah salah satu unsur yang paling umum di bumi, serta juga juga manfaatnya yang paling kita ketahui adalah unsur pernapasan bagi kehidupan manusia (bernafas), Sedangkan Hidrogen adalah suatu unsur yang paling banyak di jagat raya.</li><li>Unsur Buatan, yang dibuat didalam suatu laboratorium dan juga biasanya berusia pendek. Secara alami, tidak terdapat unsur yang lebih berat selain uranium, tetapi para peneliti mampu untuk dapat menciptakan unsur baru yang lebih berat,caranya ialah dengan menggabungkan dua unsur yang lebih kecil bersama-sama didalam kecepatan yang tinggi, Namun kebanyakan dari unsur baru tersebut tidak bertahan lama serta juga cepat pecah.</li></ul>', '', '3UN', 'ra'),
('3UN003', 'Sifat-Sifat Unsur', '<p>Selain dari Pengelompokkan di atas, Unsur Tersebut juga dikelompokkan dengan berdasarkan sistem periodik unsur oleh para ilmuan, untuk lebih mudah dibedakan menurut sifatnya. Berikut ini merupakan pengelompokkannya yang terbagi menjadi sebagai berikut.</p><ol><li>Unsur-unsur Logam Sebagian besar atas unsur yang sudah ditemukan itu merupakan unsur logam, kira-kira sekitar 3/4 dari keseluruhan unsur. Kebanyakan unsur logam tersebut mempunyai kerapatan yang tinggi, serta juga mengkilap. Unsur-unsur tersebut memiliki banyak kegunaan, dikarenakan unsur tersebut kuat, meskipun kuat unsur tersebut tetap mudah untuk dibentuk. Selain itu juga, logam juga adalah suatu penghantar panas serta juga listrik yang baik.</li><li>Unsur-unsur Nonlogam Terdapat kurang lebih 16 unsur nonlogam yang terbentuk engan secara alami. Semuanya (kecuali grafit) adalah suatu penghantar panas serta juga listrik yang buruk, sifat yang dipunyainya ini bertolak belakang dengan unsur-unsur logam. Pada suhu kamar, 4(empat) unsurnya (fosfor, karbon, sulfur, serta iodin) berupa padatan, 11(sebelas) lainnya berupa gas.</li><li>Unsur-unsur Semilogam Unsur-unsur semilogam tersebut disebut juga dengan metaloid, dapat untuk bertindak sebagai penghantar yang buruk (seperti nonlogam), tetapi juga bisa dibuat supaya menjadi penghantar yang baik (seperti layaknya logam). dikarenakan sifatnya tersebut, unsur-unsur semilogam disebut juga dengan semikonduktor. Terdapat 9(sembilan) unsur semilogam, serta semuanya berupa padatan disuhu kamar.</li></ol>', '', '3UN', 'ra'),
('4SE001', 'Pengertian Senyawa', 'Senyawa kimia adalah zat kimia murni yang terdiri dari dua atau beberapa unsur  yang dapat dipecah-pecah lagi menjadi unsur-unsur pembentuknya dengan reaksi kimia tersebut. Contohnya, dihidrogen monoksida (air, H2O) adalah sebuah senyawa yang terdiri dari dua atom hidrogen untuk setiap atom oksigen.\r\n\r\nUmumnya, perbandingan ini harus tetap karena sifat fisikanya, bukan perbandingan yang dibuat oleh manusia. Oleh karena itu, material seperti kuningan, superkonduktor YBCO, semikonduktor \"aluminium galium arsenida\", atau coklat dianggap sebagai campuran atau aloy, bukan senyawa.\r\n\r\nCiri-ciri yang membedakan senyawa adalah adanya rumus kimia. Rumus kimia memberikan perbandingan atom dalam zat, dan jumlah atom dalam molekul tunggalnya (oleh karena itu rumus kimia etena adalah C2H4 dan bukan CH2. Rumus kimia tidak menyebutkan apakah senyawa tersebut terdiri atas molekul; contohnya, natrium klorida (garam dapur, NaCl) adalah senyawa ionik.\r\n\r\nSenyawa dapat wujud dalam beberapa fase. Kebanyakan senyawa dapat berupa zat padat. Senyawa molekuler dapat juga berupa cairan atau gas. Semua senyawa akan terurai menjadi senyawa yang lebih kecil atau atom individual bila dipanaskan sampai suhu tertentu (yang disebut suhu penguraian). ', NULL, '4SE', 'talithaa26'),
('4SE002', 'Jenis Senyawa', '<p>Berikut merupakan jenis-jenis senyawa, diantaranya :</p><p>1. Asam</p><p>Asam adalah molekul atau ion yang dapat memberikan proton (ion hidrogen H+), atau, alternatifnya, dapat membentuk ikatan kovalen dengan pasangan elektron (asam Lewis).</p><p>2. Basa</p><p>Definisi umum dari basa adalah senyawa kimia yang menyerap ion hidronium ketika dilarutkan dalam air. Basa adalah lawan (dual) dari asam, yaitu ditujukan untuk unsur/senyawa kimia yang memiliki pH lebih dari 7. Kostik merupakan istilah yang digunakan untuk basa kuat. Basa dapat dibagi menjadi basa kuat dan basa lemah. Kekuatan basa sangat tergantung pada kemampuan basa tersebut melepaskan ion OH dalam larutan dan konsentrasi larutan basa tersebut.</p><p>3. Senyawa Ionik</p><p>Dalam kimia, senyawa ionik adalah senyawa kimia yang tersusun dari ion-ion yang disatukan oleh gaya elektrostatik yang disebut ikatan ionik. Senyawa ini netral secara keseluruhan, tetapi terdiri dari ion bermuatan positif yang disebut kation dan ion bermuatan negatif yang disebut anion. Masing-masing ion bisa berupa ion sederhana seperti natrium (Na+) dan klorida (Cl&minus;) dalam natrium klorida, atau spesies poliatomik seperti ion amonium (NH+4) dan karbonat (CO2&minus;3) dalam amonium karbonat. Masing-masing ion dalam senyawa ionik biasanya memiliki beberapa tetangga terdekat; dengan kata lain bukan tersusun dalam molekul, tetapi tersusun dalam sebuah jaringan tiga dimensi kontinu; ini biasanya dalam struktur kristal.</p><p>4. Garam</p><p>Dalam ilmu kimia, garam adalah senyawa ionik yang terdiri dari ion positif (kation) dan ion negatif (anion), sehingga membentuk senyawa netral (tanpa bermuatan). Garam terbentuk dari hasil reaksi asam dan basa. Komponen kation dan anion ini dapat berupa senyawa anorganik seperti klorida (Cl&minus;), dan bisa juga berupa senyawa organik seperti asetat (CH3COO&minus;) dan ion monoatomik seperti fluorida (F&minus;), serta ion poliatomik seperti sulfat (SO42&minus;). Natrium klorida (NaCl), bahan utama garam dapur adalah suatu garam.</p><p>5. Oksida</p><p>Oksida adalah senyawa kimia yang sedikitnya mengandung sebuah atom oksigen serta sedikitnya sebuah unsur lain. Sebagian besar kerak bumi terdiri atas oksida. Oksida terbentuk ketika unsur-unsur dioksidasi oleh oksigen di udara. Pembakaran hidrokarbon menghasilkan dua oksida utama karbon, karbon monoksida, dan karbon dioksida. Bahkan materi yang dianggap sebagai unsur murni pun sering kali mengandung selubung oksida. Misalnya aluminium foil memiliki kulit tipis Al2O3 yang melindungi foil dari korosi. Oksida-oksida dari unsur-unsur periode 3: Na2O, MgO, Al2O3, SiO2, P4O10, SO3, Cl2O7, P4O6, SO2, Cl2O. Oksida-oksida pada barisan pertama dikenal sebagai oksida-oksida tertinggi dari tiap unsur. Oksida-oksida ini adalah saat di mana unsur-unsur periode 3 berada pada keadaan oksidasi tertinggi. Pada oksida-oksida ini, semua elektron terluarnya terlibat dalam pembentukkan ikatan mulai dari natrium yang hanya memiliki satu elektron terluar hingga klor dengan 7 elektron terluar.</p><p>6. Senyawa Organik</p><p>Senyawa organik adalah golongan besar senyawa kimia yang molekulnya mengandung karbon, kecuali karbida, karbonat, dan oksida karbon. Studi mengenai senyawaan organik disebut kimia organik. Banyak di antara senyawaan organik, seperti protein, lemak, dan karbohidrat, merupakan komponen penting dalam biokimia.</p>', '', '4SE', 'ra');
INSERT INTO `submateri` (`kode_submateri`, `nama_submateri`, `isi_submateri`, `gbr_submateri`, `kode_materi`, `id_admin`) VALUES
('5CA001', 'Pengertian Campuran Kimia', 'Dalam kimia, campuran adalah sebuah zat yang dibuat dengan menggabungkan dua zat atau lebih yang berbeda tanpa reaksi kimia yang terjadi (objek tidak menempel satu sama lain).\r\n\r\nSementara tak ada perubahan fisik dalam suatu campuran, properti kimia suatu campuran dapat menyimpang dari komponennya seperti titik lelehnya. Campuran dapat dipisahkan menjadi komponen aslinya secara mekanis. Campuran dapat bersifat homogen atau heterogen.\r\n\r\nCampuran adalah hasil pencampuran mekanis atau pencampuran zat kimia seperti elemen dan senyawa, tanpa penyatuan kimia atau perubahan kimia lainnya, sehingga masing-masing zat mempertahankan properti dan karakteristik kimianya.', , '5CA', 'talithaa26');
INSERT INTO `submateri` (`kode_submateri`, `nama_submateri`, `isi_submateri`, `gbr_submateri`, `kode_materi`, `id_admin`) VALUES
('6HK001', 'Mengenal Hukum Dasar Kimia', '<p>Di dalam ilmu kimia, terdapat beberapa hukum &ndash; hukum dasar yang mendasari perhitungan kimia. Hukum &ndash; hukum tersebut dikenal oleh orang banyak sebagai hukum dasar kimia. Hukum dasar kimia ini akan membantu kamu dalam mempelajari stoikiometri. Hukum dasar kimia terdiri dari hukum kekekalan massa (hukum Lavoisier), hukum perbandingan tetap (hukum Proust), hukum kelipatan perbandingan, hukum perbandingan volume (hukum Gay Lussac), dan hukum Avogadro. Untuk lebih jelasnya kamu bisa membaca penjelasannya pada submateri lain.</p>', '', '6HK', 'ra'),
('6HK002', 'Hukum Kekekalan Massa (Hukum Lavoisier)', '<p>Ketika potongan logam magnesium yang telah ditimbang massanya dibakar dengan oksigen, maka akan dihasilkan magnesium oksida (MgO) yang berwujud serbuk putih.</p><p><strong>Mg (s) + O2 ---&gt; MgO (s)</strong></p><p>Reaksi ini disertai dengan pelepasan sejumlah energi dalam bentuk panas dan cahaya. Ketika magnesium oksida ditimbang, ternyata massanya lebih besar dibanding potongan logam magnesium awal. Peningkatan massa ini terjadi karena adanya oksigen yang bergabung dengan magnesium membentuk magnesium oksida.</p>', '', '6HK', 'ra');

